import React from "react";
import "./HowItWorksStep3.scss";
import { withTranslation } from 'react-i18next';

class HowItWorksStep3 extends React.Component {
  render() {
    const { t } = this.props;
    return (
      <div className="how-it-works-step-2">
        <div className="how-it-works-step-2-wrapper">
        <div className="ready-to-use-tool">
            <div className="ready-to-use-tool-header">
            {t("ready-to-use-tool-header")}    
            </div>
            <div className="ready-to-use-tool-item ready-to-use-tool-item-1">
            {t("ready-to-use-tool-item-1")}  

            </div>
            <div className="ready-to-use-tool-item ready-to-use-tool-item-2">
            {t("ready-to-use-tool-item-2")}  
            Detection of the potential development areas along with assignment of  corresponding training sessions
            </div>
            <div className="ready-to-use-tool-item ready-to-use-tool-item-3">
            {t("ready-to-use-tool-item-3")}  
            Screening potential candidates for vacancies within company both during recruitment & talent review processes
            </div>
          </div>
          <div className="ready-to-use-tool-img"></div>
        </div>
      </div>
    );
  }
}

export default withTranslation()(HowItWorksStep3);
